import '../App.css';
//import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';
import React, { Component } from 'react'
import Preview from '../pages/preview';
import Graph from '../pages/graph';
import Download from '../pages/download';



class Pagedownload extends Component {
  render() {
    return (

       <Router>
       <div className="App">
           <div className="App-header">

              <div > 
                  <Link class="home-position" to="/preview">Preview</Link> 
               </div>
              <div>
                   <Link   className="about-position"to="/graph">Graph</Link>
              </div>
              <div >
                    <Link className="contact-position"to="/download">Download</Link>
              </div>

          </div>
          <div className="optiondiv">
               <h6>Options:</h6>
               <div className="formatdiv">
                <h6>Format</h6>
              </div>

                     <div class="dropdown">
                                <button  class=" csvbutton dropdown-toggle" type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                    CSV
                                </button>
                                <div class="dropdown-menu" aria-labelledby="dropdownMenuButton">
                                        <a class="dropdown-item" href="#">Comments</a>
                                        <a class="dropdown-item" href="#">Comments</a>
                                        <a class="dropdown-item" href="#">Comments</a>
                                </div>
                            </div> 


          </div>
       <Routes>
            <Route exact path='/' element={< Download />}></Route>
            <Route exact path='/preview' element={< Preview />}></Route>
            <Route exact path='/graph' element={< Graph />}></Route>
       </Routes>
       </div>
    </Router>


   );
  }
}

export default Pagedownload;
